import Select from '@material-ui/core/Select';
import Button from '@material-ui/core/Button';
import MenuItem from '@material-ui/core/MenuItem';

const MealCategory = (props) => {
    return (
        <MuiThemeProvider>
            <AppBar position="absolute">
                <Toolbar>
                    <Typography variant="h6" color="inherit" noWrap>Step 1</Typography>
                </Toolbar>
            </AppBar>
            <Select
                name="Meal"
                value=""
                onchange="">
                <MenuItem value="">Meal</MenuItem>   
                <MenuItem value="Big Mac">Big Mac</MenuItem>   
                <MenuItem value="Fillet-o-Fish">Fillet-o-Fish</MenuItem>   
            </Select>


        </MuiThemeProvider>
    );
}

export default MealCategory;
